import React from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import "../styles/EVUserDashboard.";

const EVUserDashboard = () => {
  return (
    <div className="dashboard-container">
      <h2>EV Charging Station Locator</h2>
      <MapContainer center={[12.9716, 77.5946]} zoom={13} className="map-container">
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        />
        <Marker position={[12.9716, 77.5946]}>
          <Popup>
            Example Charging Station<br /> Bengaluru, India
          </Popup>
        </Marker>
      </MapContainer>
    </div>
  );
};

export default EVUserDashboard;
